    import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
	import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
    @GeneratorDelegateClass(componentType=DatastoreComponent.COMPONENT_TYPE_NAME, descriptionKey="GeneratorDelegateClass.HiveIncrementalUpdate")
    public class IKM_Hive_Incremental_Update extends IKM_Hive_Append {
            // class constructor; initialization is done in setBinding method
            public IKM_Hive_Incremental_Update() {}

            protected AbstractSyntaxTree stagingQueryAST
            protected boolean option_USE_STAGING_TABLE

            void updateBinding() {
            	super.updateBinding()        	
                mBinding.setVariable( "stagingQueryAST", stagingQueryAST )
                mBinding.setVariable( "option_USE_STAGING_TABLE", option_USE_STAGING_TABLE )
            }            

            SqlQuery reorderSelectList (targetAttributes, query) {

                def selectList = query.getSelectList()
                def aliasList  = query.getAliasList()

                def reorderedSelectList = // put all non-partition columns first. Then all other columns. Omit partition columns with constant value. Those are treated in partition clause.
                                           targetAttributes.collectWithIndex { col,idx -> (!col.getBoundColumn().isPartition())?selectList.get(idx):null }
                                          .plus( targetAttributes.collectWithIndex { col,idx -> ( col.getBoundColumn().isPartition() && col.referencesUpstreamAttribute() )?selectList.get(idx):null } )
                                          .findAll { (it!=null) }

                def reorderedAliasList = null
                if ( aliasList != null ) {
                reorderedAliasList = // put all non-partition columns first. Then all other columns
                                       targetAttributes.collectWithIndex { col,idx -> (!col.getBoundColumn().isPartition())?aliasList?.get(idx):null }
                                      .plus( targetAttributes.collectWithIndex { col,idx -> ( col.getBoundColumn().isPartition() && col.referencesUpstreamAttribute())?aliasList?.get(idx):null } )
                                      .findAll { (it!=null) }
                }

                query.setSelectList( reorderedSelectList )
                query.setAliasList(  reorderedAliasList )
                return query
            }

            List<Column>  reordereTargetColumns (targetCols) {
                def reorderedTargetColumns = // put all non-partition columns first. Then all other columns. Omit partition columns with constant value. Those are treated in partition clause.
                                           targetCols.findAll { col -> !col.isPartition() }
                                          .plus( targetCols.findAll { col -> (col.isPartition() && col.referencesUpstreamAttribute()) } )
                return reorderedTargetColumns
            }

			@ASTProducerMethod(processingType=ProcessingType.TARGET, producedASTType=HiveInsertStatement.class, styleKey="ProcessingStyleKey.Hive.UPDATE")
            AbstractSyntaxTree INSERT( SqlQuery input ) {
                def returnAST

                def templateUtils = input.getTemplateUtils()

                def targetTable      = getTargetTable()
                def targetColumnList = new ArrayList<Column>();

                option_USE_STAGING_TABLE = isOptionTrue("USE_STAGING_TABLE")

                setDDLTargetTable(sourceDataStore, targetDataStore, targetTable, sourceSchemaName, false);

                // Create DDL for target
                targetTableAST   = new HiveCreateTableStatement( "abc", "def", targetTable, getHiveTechnology(), ffFinder )
                targetColumnList = physicalNode.getNodeAttributes().collect { attr -> Column.getColumn( targetTable, attr ) }
                targetTableAST.setColumns( targetColumnList )

                // Create DML for insert into target table

                targetTable      = getTargetTable()
                targetColumnList = new ArrayList<Column>();

                def sourceSelectList = new ArrayList<ISelectItem>();
                def sourceSelectQuery = getSourceAndTargetExpressionsAndQuery( targetTable, input, sourceSelectList, targetColumnList,
                        { attr ->
                            // Is this an unmapped Attribute?
                            if ( !attr.isMapped() )
                                // So we have to put a casted NULL
                                return new UnmappedColumnExpression( attr.getDdlDataType() )
                            // Is this a constant value mapped on target?
                            if ( !attr.referencesUpstreamAttribute() && (attr.getExecuteOnHint() == MapExpression.ExecuteOnLocation.TARGET))
                               // So we just insert the verbatim expression text
                               return new StringExpression( attr.getExpression().getText(), attr )
                            // Ok, then this must be a mapped source column, which we just copy over
                            return new CopyColumnExpression()
                        }  )

		stagingQueryAST = sourceSelectQuery

		def stagingSelectQuery = sourceSelectQuery.createQuery()		
		def stagingSelectList = new ArrayList<ISelectItem>();
		def stagingAliasList = new ArrayList<StringExpression>()

		def sourceAliasList = sourceSelectQuery.getAliasList()		

		sourceAliasList.each {
                    StringExpression newItem = new StringExpression(it.getText(), it)
                    stagingSelectList.add(newItem)
                    stagingAliasList.add(it)		
		}

		stagingSelectQuery.setSelectList(stagingSelectList)
                stagingSelectQuery.setAliasList(stagingAliasList)

		HiveTable stagingTable = getStagingTable()

                FromClause stagingFrom = new FromClause(new TableReference(stagingTable), "I_ALIAS")
                stagingSelectQuery.addFrom(stagingFrom)                

                if (option_TRUNCATE) {
		    if (option_USE_STAGING_TABLE) {
		      sourceSelectQuery = stagingSelectQuery
		    }
                    intoTargetAST = new HiveInsertStatement( targetTable, targetColumnList, sourceSelectQuery, ffFinder )
                } else {
                    def targetSelectQuery = sourceSelectQuery.createQuery()
                    def targetSelectList = new ArrayList<ISelectItem>()
                    def targetAliasList = new ArrayList<StringExpression>()
                    def targetKeyColsList = new ArrayList<ISelectItem>()
                    def targetPartColsList = new ArrayList<ISelectItem>()
                    def targetStaticPartColsList = new ArrayList<ArrayExpression>()

                    def sourceKeySelectQuery = sourceSelectQuery.clone()
                    def sourcePartSelectQuery = sourceSelectQuery.clone()

                    def stagingKeyColsList = new ArrayList<ISelectItem>()
                    def stagingKeyAliasList = new ArrayList<StringExpression>()
                    def stagingKeySelectQuery = stagingSelectQuery.clone()
                    def stagingPartColsList = new ArrayList<ISelectItem>()
                    def stagingPartAliasList = new ArrayList<StringExpression>()
                    def stagingPartSelectQuery = stagingSelectQuery.clone()                   

                    def subWhereKeySrcExpressions = []
                    def subWhereKeyStgExpressions = []
                    def subWherePartSrcExpressions = []
                    def subWherePartStgExpressions = []                    

                    physicalNode.getNodeAttributes().each {

                            def expr = it.getSQLAccessName(true)
                            StringExpression newItem = new StringExpression(expr, it, it)
                            targetSelectList.add(newItem)

                            def alias = it.getSQLAliasName()
                            StringExpression newAlias = new StringExpression(alias)
                            targetAliasList.add(newAlias)

                            if (it.isKeyIndicator()) {
                                def tgtExpr = new StringExpression(expr, it, it)
                                targetKeyColsList.add(tgtExpr)
                                def srcKeyExpr, stgKeyExpr

                                sourceKeySelectQuery.getSelectList().eachWithIndex {v,i ->
				  if (v.getTargetColumnName().equals(it.getName())) {
                                    srcKeyExpr = v
				    stgKeyExpr = stagingSelectList[i]
				    stagingKeyColsList.add(stgKeyExpr)
				    stagingKeyAliasList.add(stagingAliasList[i])
				  }                                
                                }
                                def subWhereText =  tgtExpr.getText() + ' = ' + srcKeyExpr.getText()
                                def srcExpression = it.getExpression().clone()                              
                                srcExpression.setText(subWhereText)
                                subWhereKeySrcExpressions.add([srcExpression, srcKeyExpr.getText().split('\\.')[0]])

                                subWhereText =  tgtExpr.getText() + ' = I_ALIAS.' + stgKeyExpr.getText()                               
                                def stgExpression = it.getExpression().clone()
                                stgExpression.setText(subWhereText)
                                subWhereKeyStgExpressions.add([stgExpression, ''])                                                               
                            }

                            if (it.getBoundColumn().isPartition()) {
                                if (it.referencesUpstreamAttribute()) {
                                    def tgtExpr = new StringExpression(expr, it, it)
                                    targetPartColsList.add(tgtExpr)
                                    def srcPartExpr, stgPartExpr

				    sourcePartSelectQuery.getSelectList().eachWithIndex {v,i ->
				      if (v.getTargetColumnName().equals(it.getName())) {
                                        srcPartExpr = v
					stgPartExpr = stagingSelectList[i]
					stagingPartColsList.add(stgPartExpr)
					stagingPartAliasList.add(stagingAliasList[i])
				      }                                
				    }

                                    def subWhereText =  tgtExpr.getText() + ' = ' + srcPartExpr.getText()
                                    def srcExpression = it.getExpression().clone()
                                    srcExpression.setText(subWhereText)
                                    subWherePartSrcExpressions.add([srcExpression, srcPartExpr.getText().split('\\.')[0]])

                                    subWhereText =  tgtExpr.getText() + ' = I_ALIAS.' + stgPartExpr.getText()                               
                                    def stgExpression = it.getExpression().clone()
                                    stgExpression.setText(subWhereText)
                                    subWherePartStgExpressions.add([stgExpression, ''])
                                } else {
                                    def tgtexpr = it.getExpression()
                                    if (tgtexpr != null) { 
                                        def whereText =  expr + ' = ' + tgtexpr.getParsedText()
                                        def newExpression = tgtexpr.clone() 
                                        newExpression.setText(whereText)   
                                        targetStaticPartColsList.add(new ArrayExpression(physicalNode, newExpression, targetSelectQuery))
                                    }
                                }                                 
                            }
                    }

                    if (targetKeyColsList.size() == 0) {
                        throw new OdiKMException("ODIKM-HADOOP-IKM-10000", "ERROR: At least one attribute on target must be defined as a key in order to use IKM Hive Incremental Update. Either define a key or use IKM Hive Append.", null )
                    }                    

                    stagingKeySelectQuery.setSelectList(stagingKeyColsList)
                    stagingKeySelectQuery.setAliasList(stagingKeyAliasList)                   
                    stagingPartSelectQuery.setSelectList(stagingPartColsList)
                    stagingPartSelectQuery.setAliasList(stagingPartAliasList)                    

                    if (option_USE_STAGING_TABLE) {
		      sourceSelectQuery = stagingSelectQuery
		      sourceKeySelectQuery = stagingKeySelectQuery
		      sourcePartSelectQuery = stagingPartSelectQuery
		      subWhereKeySrcExpressions = subWhereKeyStgExpressions
		      subWherePartSrcExpressions = subWherePartStgExpressions
		    } 

                    targetSelectQuery.setSelectList(targetSelectList)
                    targetSelectQuery.setAliasList(targetAliasList)

                    def tableAlias = generatorContext.generateUniqueAlias(physicalNode)
                    FromClause from = new FromClause(new TableReference(targetTable), tableAlias)
                    targetSelectQuery.addFrom(from)

                    if ( targetPartColsList.size() > 0 ) {
                        // partitioning
                        def partSubQuery = targetSelectQuery.clone()

                        def sourcePartWhereCondition = new ArrayList<ArrayExpression>()
                        subWherePartSrcExpressions.each {
                          def cond = new ArrayExpression(physicalNode, it[0], sourcePartSelectQuery)
                          if (it[1] != '') {
                            cond.setAlias(it[1])
                          }
                          sourcePartWhereCondition.add(cond)
                        }

                        def sourcePartWhereList = sourcePartSelectQuery.getWhereList()

                        if (sourcePartWhereList == null) {
                          sourcePartWhereList = new ArrayList<IConditionItem>()
                        }

                        sourcePartWhereCondition.each {
                          sourcePartWhereList.add(it)                                         
                        }  

                        sourcePartSelectQuery.setWhereList(sourcePartWhereList)

                        // sourcePartSelectQuery.setIsDistinct(true)
                        def filterPartSubQuery = new FilterSubQuery(sourcePartSelectQuery)
                        filterPartSubQuery.setQueryRole(FilterSubQuery.QueryRole.valueOf("EXISTS"))

                        def partWhereList = new ArrayList<IConditionItem>()
                        partWhereList.add(filterPartSubQuery)
                        partSubQuery.setWhereList(partWhereList)

                        partSubQuery = reorderSelectList(physicalNode.getNodeAttributes(), partSubQuery)

                        targetSelectQuery.getFromList().clear()
                        FromClause subfrom = new FromClause(partSubQuery, tableAlias)
                        targetSelectQuery.addFrom(subfrom)
                    } 

                    // ===============================================

                    def whereList = new ArrayList<IConditionItem>()

                    targetStaticPartColsList.each {
                       whereList.add(it)                                         
                    }

                    // ===============================================

                    def subWhereCondition = new ArrayList<ArrayExpression>()

                    subWhereKeySrcExpressions.each {
                      def cond = new ArrayExpression(physicalNode, it[0], sourceKeySelectQuery)
                      if (it[1] != '') {
                        cond.setAlias(it[1])
                      }
                      subWhereCondition.add(cond)
                    }

                    def subWhereList = sourceKeySelectQuery.getWhereList()

                    if (subWhereList == null) {
                      subWhereList = new ArrayList<IConditionItem>()
                    }

                    subWhereCondition.each {
                       subWhereList.add(it)                                         
                    }
                    sourceKeySelectQuery.setWhereList(subWhereList)

                    // ===============================================

                    def filterSubQuery = new FilterSubQuery(sourceKeySelectQuery)
                    filterSubQuery.setQueryRole(FilterSubQuery.QueryRole.valueOf("NOT_EXISTS"))

                    whereList.add(filterSubQuery)
                    targetSelectQuery.setWhereList(whereList)

                    sourceSelectQuery = reorderSelectList(physicalNode.getNodeAttributes(), sourceSelectQuery)
                    targetSelectQuery = reorderSelectList(physicalNode.getNodeAttributes(), targetSelectQuery)

                    targetSelectQuery.setSetOperand(sourceSelectQuery)
                    targetSelectQuery.setSetOperation("UNION ALL")

                    targetSelectQuery.generateUniqueAliases()

                    intoTargetAST = new HiveInsertStatement( targetTable, targetColumnList, targetSelectQuery, false, ffFinder )
                }

                initTargetAST( intoTargetAST )

                // Overwrite target data?
                intoTargetAST.overwrite = true

                // Publish variables into binding to make them available in templates and variableDefText
                updateBinding()

                //return intoTargetAST
                return intoTargetAST
              }
          }

stagingRuntimeAccessName = OdiRef.getOdiGeneratedAccessName("INT_NAME", physicalNode, "W")
